import React from "react";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

function Playlist(props) {
  let [genres, setGenres] = useState([""]);

  useEffect(() => {
    axios
      .get("https://deezerdevs-deezer.p.rapidapi.com/genre/%7Bid%7D")
      .then((res) => {
        console.log(res.data);
        setGenres(res.data);
      });
  }, []);

  return (
    <div>
      <h3>Now that you've got your itinerary, what vibe are you going for?</h3>
      <select name="cars" id="cars" multiple>
        <label value="volvo">Volvo</label>
        <label value="saab">Saab</label>
        <label value="opel">Opel</label>
        <label value="audi">Audi</label>
      </select>
      <Link to="/myexperience">
        <button>Finish: Trip Experience</button>
      </Link>
    </div>
  );
}

export default Playlist;
